def make_png_id_bangla(name, father, mother, tecnologi, seson, bordroll, photo):
    # font page html
    font_page = '''"""<!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <link href="https://fonts.maateen.me/kalpurush/font.css" rel="stylesheet">
        <style>
    * {
        margin: 0;
        padding: 0;
    }

    .container {
        height: 100vh;
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: space-around;
        flex-wrap: wrap;
        box-sizing: border-box;
        flex-direction: row;
    }

    .font {
        height: 800px;
        width:500px;
        position: relative;
        border-radius: 10px;
        background-image: url('data:image/png;base64,');
        background-size: 500px 800px;
        background-repeat: no-repeat;
    }

    .edetails {
        position: absolute;
        top: 500px;
        line-height: 25px;
        left: 30px;
        text-transform: capitalize;
        font-family: 'Kalpurush', sans-serif;
        font-size: 25px;
         /* Changed 'text-emphasis' to 'letter-spacing' */
        margin-left: 7px;
    }

    .top img {
        height: 200px;
        width: 200px;
        background-color: #d3760c;
        border-radius: 100%; /* Changed '99px' to '50%' */
        position: absolute;
        top: 150px;
        left: 29%;
        object-fit: cover; /* Changed 'content' to 'cover' */
        border: 4px solid rgba(255 , 255 , 255 , .2);
    }

    .ename {
        position: absolute;
        font-family: "Li Niladri Rongtuli Unicode",sans-serif;
        top: 380px;
        left: 182px;
        color: rgb(0, 0, 0);
        font-size: 28px;
    }

    .signature {
        position: absolute;
        top: 81%;
        height: 200px;
        width: 400px;
    }

    .signature img {
        height: 80px;
        width: 220px;
        margin: 40px 0 0 140px;
        border-radius: 7px;
    }
        </style>
    </head>
    <body>
        <!-- font id design -->
        <div class="container">
            <div class="padding">
                <div class="font">
                    <div class="top">
                        <img src="@PHOTO">
                    </div>
                    <div class="">
                        <div class="ename">
                            <p class="p1"><b>@NAME</b></p>
                        </div>
                        <div class="edetails">
                            <p><b>  : @Father_name</b></p>
                            <p><b>  : @Mother_name</b></p>
                            <p><b> : @Tecnologi</b></p>
                            <p><b> : @Seson</b></p>
                        </div>
                        <div class="signature">
                            <img src="data:image/png;base64," alt="">
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </body>
    </html>"""'''
    # replace html defolt value with usar defain valu
    font_page = font_page.replace("@NAME", name)
    font_page = font_page.replace("@Father_name", father)
    font_page = font_page.replace("@Mother_name", mother)
    font_page = font_page.replace("@Seson", seson)
    font_page = font_page.replace("@Tecnologi", tecnologi)
    font_page = font_page.replace("@PHOTO", photo)
    # v set save path
    output_image_path_png = f"Id Card/font_{bordroll}.png"
#   output_image_path_pdf = f"Id Card/font_{bordroll}.pdf"

    # Convert HTML to image
    hti = Html2Image()
    image_path_png = hti.screenshot(html_str=font_page)[0]
    image_path_pdf = hti.screenshot(html_str=font_page)[0]

    # Load the image using Pillow
    image_png = Image.open(image_path_png)
    image_pdf = Image.open(image_path_pdf)

    # Save the image
    image_png.save(output_image_path_png, quality=150)
    # image_pdf.save(output_image_path_pdf, quality=150)


